import './App.css';
import { AppCard } from './AppCard';
import pic1 from './img/pic1.jpg';


export function AppList() {
    return (
      <div className="grid">
        <AppCard img={pic1} text={'Counter'}/>
        <AppCard img={'./img/pic2.jpg'} text={'App-2'}/>
        <AppCard img={'./img/pic3.jpg'} text={'App-3'}/>
        <AppCard img={'./img/pic4.jpg'} text={'App-4'}/>
        <AppCard img={'./img/pic5.jpg'} text={'App-5'}/>
        <AppCard img={'./img/pic6.jpg'} text={'App-6'}/>
      </div>
    )
}
